import './App.css';
// import { GFMap } from './components/GFMap';
// import { GroundMap } from './components/GroundMap';
// import { GroundMapp } from './components/GroundMapp';
// import { TestGround } from './components/TestGround'

function App() {
  const people = [
    { name: "name 1" },
    { name: "name 2" },
    { name: "name 3" },
    { name: "name 4" },
    { name: "name 5" },
    { name: "name 6" },
    { name: "name 7" },
    { name: "name 8" }
  ];

  const person = {
    name: "freelancing",
    twitter: "freelancingcult",
    bio: "Programming"
  };

  let details = [];
  for (const property in person) {
    details.push(
      <p>
        {property}: {person[property]}
      </p>
    );
  }
  return (
      <div className="App">
        {/* <GFMap></GFMap> */}
        {/* <GroundMap></GroundMap> */}
        {/* <GroundMapp></GroundMapp> */}
        {/* <TestGround></TestGround> */}

        <h2>Json Array Object </h2>
        {people.map((data, idx) => (
          <p key={idx}>{data.name}</p>
        ))}

        <h2>Json Object </h2>
        {/* {Object.keys(person).map((key, idx) => (
          <p key={idx}>{person[key]}</p>
        ))} */}

        <h2>Json Object using forloop</h2>
        {details}
        </div>
  )
}

export default App;
